import React from "react";
import ReactDOM from "react-dom";
// import App from "./App";


ReactDOM.render(
    <>
<div className="cards">
    <div className="card">
     <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.talenthouse.com%2Fitem%2F2091159%2F929b39c7&psig=AOvVaw3kdFgQxWm5mTqqKF9tDAFr&ust=1630829825835000&source=images&cd=vfe&ved=0CAgQjRxqFwoTCKC-htjw5PICFQAAAAAdAAAAABAD" alt="myPic" className="card_img1"/>

     <div className="card_info">
      <span className="card_category">A Netflix Original Series </span>
       <h3 className="card_title>"> </h3>
         <a href="" target="_blank">
          <button>Watch Now</button>
         </a>
     </div>
    </div>
</div>
    </>,
    document.getElementById("root")
);
